import React, { useState } from 'react';

function BoutonBascule() {
  const [estClique, setEstClique] = useState(false);

  return (
    <div>
      <button onClick={() => setEstClique(!estClique)}>Cliquez-moi</button>
      <p>{estClique ? 'Cliqué' : 'Non Cliqué'}</p>
    </div>
  );
}

export default BoutonBascule;
